static void test_header( int heading )
{
        int n;

        /*
         *  If header[heading] is -1 it can only be set by headings that
         *  come after it, so that the comment will always appear after 
         *  it's section has been completed.  This is the case for CAST.
         */

        if ( header[heading] != EXAMPLE_ALWAYS )
        {
	     header[heading] = DATA_EXISTS;
        }

        output = 1;

        for ( n = 0; n < heading; n++ )
        {
              if ( header[ n ] != DATA_EXISTS )
              {
                   /*  Do not show certain headings for TV titles  */

		   switch ( n )
                   {
                       case CERTS :
		       case TAG :
		       case TECH :
                       case LIT :
                       case PRODCO :
                       case TIMES :
                       case CINEM :
                       case COST  :
                       case DESIG :
                       case TRIV  :
                       case CRAZY :
		       case SOUND :
                       case GOOF  :
                       case COMMENT :
		       case ALT :
		       case BUSINESS :
                       {
                           if ( tv == 0 )
                               give_example( n );
                           else
                               header[ heading ] = DATA_EXISTS;
                           break;
                       }
                       default:
                       {
                           give_example( n );
                           break;
                       }
                   }
              }
        }
}

static void give_example( int heading )
{
        /*
         *  Mark that an example has been given, therefore data 
         *  now exists.
         */

	header[ heading ] = DATA_EXISTS;

        if ( heading == CAST )
        {
 		if ( !strstr( yytext, "Cast" ) )
		{
			printf( "Cast:\n" );
		}
		else
		{
		        printf( "%s", yytext );
		}
        }
        else if ( xmpl_head[ heading ] != NULL )
        {
            printf( "%s", xmpl_head[ heading ] );
        }

	if ( bare == 0 )
        {
  	    if ( xmpl_text[ heading ] != NULL )
            {
       	        printf( "%s", xmpl_text[heading] );
            }
        }
        else
            printf( "\n" );

}
